export default function UserManagement() {
  return (
    <div className="min-h-screen p-6 animate-fadeInUp">
      <h1 className="text-3xl font-bold mb-4">
        User Management
      </h1>
      <p className="text-gray-600">
        Admin-only page. User promotion features coming soon.
      </p>
    </div>
  );
}
